function bpunkteRec($id,$level)
{
    global $_BAU;
    
    $liSumRess = $_BAU[$id][2] + $_BAU[$id][3] + $_BAU[$id][4] + $_BAU[$id][5];
    
    $liPunkte = $liSumRess / 1000;
    
    $liScore = formel_stufe($level) * $liPunkte;
    
    return $level == 0 ? $liScore : $liScore + bpunkteRec($id,$level-1);
}



function test()
{
    $liStartMath = microtime(true);
    bpunkte(3,50);
    $liTotalMath = microtime(true) - $liStartMath;
    
    $liStartRec = microtime(true);
    bpunkteRec(3,50);
    $liTotalRec = microtime(true) - $liStartRec;
    
    
    return array($liTotalMath,$liTotalRec);
}
